import './App.css';

function App() {
  return (
    <main className="main-container">
      <section>
        <h3>Faça seu login</h3>
        <label>
          Login
          <input type="text" placeholder="Digite seu usuário"></input>
        </label>
        <label>
          Senha
          <input type="password" placeholder="Digite sua senha"></input>
        </label>
      </section>
    </main>
  );
}

export default App;
